import logo from './logo.svg';
import './App.css';
import { BrowserRouter, Routes, Route, Navigate } from 'react-router-dom';

function App() {
  return (
    <div className='w-screen h-screen font-poppins'>
      <BrowserRouter>
        <Routes>
          <Route
            path='/home'
            element=<LoggedInHome />
          />
          <Route
            path='/formpage'
            element=<About />
          />
          <Route
            path='/help'
            element=<Contact />
          />
          <Route
            path='*'
            element=<LoggedInHome />
          />
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
